You may set the following properties to further configure the call. Please note that  -p  is followed by one 
or more key-value-pairs, and is called like this  -p k1=v1 k2=v2  even though the listing below repeats the -p  for completeness.    -p page-size=integer   The maximum number of entries that are requested.     -p page-token=string   A pagination token returned from a previous call to SearchVersions
    that indicates where this listing should continue from.
    This field is optional.     -p query=string    The query to filter the versions. Required.  The supported queries are:
* List versions under a product: parent=catalogs/{catalog_id}/products/{product_id} 
* Get a version by name: name=catalogs/{catalog_id}/products/{product_id}/versions/{version_id}

